  
  
  const image1 =new Image()
  image1.src='data:image/png;base64,'
  const canvas =document.getElementById('canvas1')
  const ctx =canvas.getContext('2d')
  canvas.width=window.innerWidth
  canvas.height=window.innerHeight

  window.addEventListener('resize',()=>{
    canvas.width=window.innerWidth
    canvas.height=window.innerHeight
  })
  window.addEventListener('load' , ()=>{
    document.querySelector('.textbox').classList.add('gradual')
  })

  image1.addEventListener('load',function(){
    drawstart()
  })


  function drawstart(){
    let particlearray=[]
    let MapImagearray=[]
    ctx.drawImage(image1,0,0,canvas.width ,canvas.height)
    const scannerImage = ctx.getImageData(0,0,canvas.width,canvas.height)
    ctx.clearRect(0,0,canvas.width,canvas.height)
    const pixels =scannerImage.data
    for(let  y=0 ; y<canvas.height ; y++){
      let row=[]
      for(let x=0 ; x<canvas.width ;  x++){
        const red =pixels[(y*canvas.width*4)+(x*4)]
        const blue =pixels[(y*canvas.width*4)+(x*4)+1]
        const green =pixels[(y*canvas.width*4)+(x*4)+2]
        const brightness = Brightness(red,green,blue)
        const cell=[
          cellBrightness = brightness
        ]
        row.push(cell)
      }
      MapImagearray.push(row)
    }
    console.log(MapImagearray)
    function Brightness(red,blue,green){
      return Math.sqrt(
        (red*red)*0.299+
        (blue*blue)*0.114+
        (green*green)*0.587
      )/100
    }
    class Particle{
      constructor(){
        this.x=Math.random()*canvas.width
        this.y=-0
        this.size=Math.random()*3
        this.speed=0
        this.velocity = Math.random()*0.5+3
        this.color='white'
        this.position1 = Math.floor(this.y)
        this.position2 = Math.floor(this.x)
      }
      update(){
        this.position1 = Math.floor(this.y)
        this.position2 = Math.floor(this.x)
        this.speed=MapImagearray[this.position1][this.position2][0]
        let movement = 2-(this.speed)+this.velocity
        this.y+=movement
        if(this.y >= canvas.height){
          this.y=0
          this.x=Math.random()*canvas.width
        }
      }
      draw(){
        if(this.y>=this.size){
          ctx.fillStyle=this.color
          ctx.beginPath()
          ctx.arc(this.x,this.y,this.size,0,2*Math.PI)
          ctx.fill()
        }
      }
    }
    
    function init(){
      for(let i=0 ; i<11000; i++){
        let a=new Particle();
        particlearray.push(a)
      }
    }
    
    init()
    
    function animate(){
      ctx.globalAlpha=0.05
      ctx.fillStyle='rgb(0,0,0)'
      ctx.globalAlpha=0.07
      ctx.fillRect(0,0,canvas.width ,canvas.height)
      for(let i=0 ; i<particlearray.length ; i++){
        particlearray[i].update()
        ctx.globalAlpha = particlearray[i].speed*1+0.01
        particlearray[i].draw()
      }
      requestAnimationFrame(animate)
    }
    animate()
  
  }
